class RealEstat extends React.Component {
   
  
    render() {
            return (
            <div>
                <img src={this.props.item.image_url} alt="house" />
                <div class="basic-info">
                  <span style="margin-left: 3%;">{propertie.beds} BDS | {propertie.baths} ba | {propertie.sqft} sqr</span>
                  <span style="float: right;margin-right: 3%;">{propertie.list_price}$</span>
                </div>
            </div>
            );
    }
  }
  
  export default RealEstat;
